import React, { Component } from 'react'
import axios from 'axios'
export class Handler extends Component {

    constructor(props) {
        super(props);

        this.state = {
            lvl: props.lvl,
            row : '',
            columns : ''
        }

         axios.post('http://localhost:8080/1729197/logus?user=' + this.state.userName + '&' + 'password=' + this.state.passWord, {
             })
                .then((response) => {
                    console.log(response);
            }
            )

    }
    renderSwitch(param) {
        switch (param) {
            case 'Level 2':
                break;
            case 'Level 3':
                break;
            default:
                
                break;
        }
    }


    render() {
        return (
            <div>
                {this.renderSwitch(this.state.lvl)}

            </div>
        )
    }
}

export default Handler
